import React, {Component} from 'react';
import Counter from "../counter/counter"
import './counterList.css'

class CounterList extends Component {

    state = {
        counters: [
            { id: 1, value: 0},
            { id: 1, value: 0},
            { id: 1, value: 0},
            { id: 1, value: 0},
        ]
    }

    // constructor(props) {
    //     super(props)
    //
    // }

    render() {
        return (
            <div>
                <Counter ></Counter>
            </div>
        );
    }
}

CounterList.propTypes = {};
export default CounterList;
